import { Image, StatusBar, Text, View } from "react-native";
import Content from "../Components/EventScreen/Content";

export default function EventScreen({navigation}) {
  const id = navigation.getParam("id");
  console.log(id)
    return (
      <View >
        <Content id={id}/>
        <StatusBar style="auto" />
      </View>
    );
  }
